import './App.css';
import { ThemeProvider, Box, Container } from '@mui/system';
import { theme } from './themes/theme';

import Header from './components/Header';
import Footer from './components/Footer';
import Profile from './components/Profile';
import Resume from './pages/Resume';

function App() {
  return (
    <ThemeProvider theme={theme}>
      <Container>
        <Box
          sx={{
            display: 'grid',
            gridTemplateColumns: 'repeat(4, 1fr)',
            gap: 1,
            gridTemplateRows: 'auto',
            gridTemplateAreas: `"sidebar header header header"
          "sidebar main main main"
          "sidebar footer footer footer"`,
          }}
        >
          <Box sx={{ gridArea: 'header'}} component={Header}>Header</Box>
          <Box sx={{ gridArea: 'main'}} component={Resume}>Main</Box>
          <Box sx={{ gridArea: 'sidebar'}} component={Profile}>Sidebar</Box>
          <Box sx={{ gridArea: 'footer'}} component={Footer}>Footer</Box>
        </Box>
        <Box component={Header} />
        <Box component={Profile} />
        <Box component={Resume} />
        <Box component={Footer} />
      </Container>
    </ThemeProvider>
  );
}

export default App;
